  false,\n\t\"url\": null,\n\t\"notes\": \"NODC Accession 0112222 includes chemical,
  discrete sample, physical and profile data collected from HOKKO MARU in the North
  Pacific Ocean from 2003-07-01 to 2003-07-11 and retrieved during cruise HK0307 and
  PACIFICA_49H520030701. These data include DISSOLVED INORGANIC CARBON, HYDROSTATIC
  PRESSURE, NITRATE + NITRITE CONTENT (CONCENTRATION), PHOSPHATE, SALINITY, SILICATE
  and WATER TEMPERATURE. The instruments used to collect these data include CTD, Coulometer
  for DIC measurement and bottle. These data were collected by Tsuneo Ono of National
  Research Institute of Fisheries Science as part of the PACIFICA_49H520030701 data
  set.nnPACIFICA (PACIFic ocean Interior CArbon) was an international collaborative
  project for the data synthesis of ocean interior carbon and its related parameters
  in the Pacific Ocean. The North Pacific Marine Science Organization (PICES), Section
  of Carbon and Climate (S-CC) supported the project.\",\n\t\"owner_org\": \"e811f0b4-451f-4896-9e8f-fc6802837819\",\n\t\"extras\":
